import React, { useState } from "react";
import { withRouter } from "react-router-dom";
import "../../components/bio-cards/science-bio-card.component.css";

const ScienceBioCardComponent = ({
  name,
  area,
  description,
  match,
  imageUrl,
  id,
  history,
}) => {
  return (
    <div
      className="science-bio-card"
      //   nClick={() => history.push(`${match.url}${linkUrl}`)}
    >
      <div className="science-upper-container">
        <img
          className="science-portrait"
          src={`url(${imageUrl})`}
          alt={name}
          height="230px"
          styles={{ backgroundPosition: "center" }}
        />
        <div className="science-image-container">
          <img
            src="images/logos/beaker.png"
            alt="logo"
            width="25px"
            height="25px"
          />
        </div>
      </div>
      <div className="science-lower-container">
        <h3 className="name">{name.toUpperCase()}</h3>
        <h4 className="area">SCIENCE}</h4>
        <p className="description">{description}</p>
      </div>
    </div>
  );
};
export default withRouter(ScienceBioCardComponent);
